    <div className="card"> 
    <img src="https://images.unsplash.com/photo-1541789094913-f3809a8f3ba5?ixlib=rb-1.2.1&ixid=MXwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHw%3D&auto=format&fit=crop&w=750&q=80"/>
    <h1> ye pic kis ki hai</h1>
    <h3>jis ki hai le le</h3>    
    <button>Watch Now</button>
    </div>
    </div>
    </>
    )
}

export default Card;
